# ============================================================
# Helpers
# ============================================================
@njit(int32(int64))
def count_bits(bb):
    c = 0
    while bb:
        bb &= bb - 1
        c += 1
    return c

@njit(int32(int64))
def lsb_index(bb):
    sq = 0
    t = bb & (-bb)
    while t > 1:
        t >>= 1
        sq += 1
    return sq

@njit(int32(int32))
def mirror_sq(sq):
    return ((7 - (sq >> 3)) << 3) | (sq & 7)

# ============================================================
# NNUE forward (quantized integer, sparse accumulation)
# ============================================================
@njit(int32(int64[:]))
def nnue_forward(board_pieces):
    acc = np.zeros(HIDDEN, dtype=np.int32)
    for i in range(HIDDEN):
        acc[i] = int32(Q_B1[i])

    for pc in range(12):
        bb = board_pieces[pc]
        base = pc * 64
        while bb:
            sq = lsb_index(bb)
            bb &= bb - 1
            f = base + sq
            for i in range(HIDDEN):
                acc[i] += int32(Q_W1[i, f])

    for i in range(HIDDEN):
        if acc[i] < 0:
            acc[i] = 0
        elif acc[i] > QA:
            acc[i] = QA

    out = Q_BO
    for i in range(HIDDEN):
        out += acc[i] * int32(Q_WO[i])
    out = out // OUT_SCALE

    return int32(out)

